def get_indexer(
    self,
    target: AnyArrayLike,
    method: Optional[str] = None,
    limit: Optional[int] = None,
    tolerance: Optional[Any] = None,
) -> np.ndarray:
    self._check_method(method)

    if self.is_overlapping():
        msg = "cannot handle overlapping indices; use IntervalIndex.get_indexer_non_unique"
        raise InvalidIndexError(msg)

    target_as_index = ensure_index(target)

    if isinstance(target_as_index, IntervalIndex):
        result = np.empty(len(target_as_index), dtype="intp")

        # Compute result using left and right indexes
        for i in range(len(target_as_index)):
            left_index = self.left.get_loc(target_as_index.left[i])
            right_index = self.right.get_loc(target_as_index.right[i])
            if left_index == right_index:
                result[i] = left_index
            else:
                result[i] = -1
        return result
    else:
        # Handle non-IntervalIndex targets
        indexer = target_as_index.get_indexer(self)
        if tolerance is not None:
            indexer[isna(target_as_index)] = -1
        return indexer
